import { Container } from 'react-bootstrap';
import SingleBlock from './SingleBlock';
import { TitleField, BodyField } from '../Fields';

class Blockchain extends Component {
    constructor(props) {
        super(props);
        const [title, body] = ["Blockchain [WORK IN PROGRESS] ", "Blockchain's Description"];
        this.state = {
            title,
            body,
            //blockArray: [1,2,3]
        }
    }

    render() {
        return (
            <Container fluid>
                <TitleField titleText={this.state.title} />
                <BodyField bodyText={this.state.body} />
                <div class = "row justify-content-around" >
                    <div class = "col-sm-4">
                        <SingleBlock  />
                    </div>
                    <div class = "col-sm-4">
                        <SingleBlock  />
                    </div>
                    <div class = "col-sm-4">
                        <SingleBlock  />
                    </div>
                </div>
            </Container>
        );
    }
}

export default Blockchain;
